<script>
    jQuery(document).ready(function($) {
    // Tooltip content mapping
    var tooltips = {
        '#german': 'German',
        '#portuguese': 'Portuguese',
        '#spanish': 'Spanish',
        '#italian': 'Italian',
        '#french': 'French',
        '#english': 'English'
    };
    
    // Create tooltip elements
    $.each(tooltips, function(selector, text) {
        // Create tooltip container
        var tooltip = $('<div class="custom-tooltip"></div>')
            .text(text)
            .css({
                'position': 'absolute',
                'bottom': 'calc(100% + 10px)',
                'left': '50%',
                'transform': 'translateX(-50%)',
                'padding': '8px 16px',
                'background-color': '#000',
                'color': '#fff',
                'font-size': '16px',
                'border-radius': '4px',
                'white-space': 'nowrap',
                'z-index': '999',
                'min-width': '50px',
                'opacity': '0',
                'visibility': 'hidden',
                'transition': 'all 0.3s ease',
                'pointer-events': 'none'
            });
        
        // Create tooltip arrow
        var arrow = $('<div class="custom-tooltip-arrow"></div>')
            .css({
                'position': 'absolute',
                'bottom': '100%',
                'left': '50%',
                'transform': 'translateX(-50%)',
                'border-width': '6px',
                'border-style': 'solid',
                'border-color': '#000 transparent transparent transparent',
                'z-index': '999',
                'opacity': '0',
                'visibility': 'hidden',
                'transition': 'all 0.3s ease',
                'pointer-events': 'none'
            });
        
        // Add elements to DOM
        $(selector)
            .css('position', 'relative')
            .css('cursor', 'pointer')
            .append(tooltip)
            .append(arrow);
        
        // Hover events
        $(selector).hover(
            function() {
                // Mouse enter
                $(this).find('.custom-tooltip').css({
                    'opacity': '1',
                    'visibility': 'visible',
                    'bottom': 'calc(100% + 15px)'
                });
                $(this).find('.custom-tooltip-arrow').css({
                    'opacity': '1',
                    'visibility': 'visible',
                    'bottom': 'calc(100% + 9px)'
                });
            },
            function() {
                // Mouse leave
                $(this).find('.custom-tooltip').css({
                    'opacity': '0',
                    'visibility': 'hidden'
                });
                $(this).find('.custom-tooltip-arrow').css({
                    'opacity': '0',
                    'visibility': 'hidden'
                });
            }
        );
    });
});
    </script>
